
	(5,'Big Data Analytics','Raj Kamal','Big data refers to data that is so large, fast or complex that it’s difficult or impossible to process using traditional methods. The act of accessing and storing large amounts of information for analytics has been around for a long timeWith the growth in the Internet of Things, data streams into businesses at an unprecedented speed and must be handled in a timely manner. RFID tags, sensors and smart meters are driving the need to deal with these torrents of data in near-real time.This book really works well for everyone!.', 20, 20, 'Data', 'data:image/png;base64,'),
	(6,'SQL for Begineers','Craig Berg','This book covers all the basic concepts you need to learn as a beginner. It will teach you various concepts, such as making and removing tables, where clauses, and more. It is simple, concise, and easy to understand. It is also for those who want to learn SQL for their web applications or any SQL database project requiring SQL. If you are going to start your journey, this book will be an essential guide for you.', 20, 20, 'Data', 'data:image/png;base64,
');