INSERT INTO `book` VALUES 
    (2,'Become a Guru in JavaScript','Lena','JavaScript is a lightweight interpreted programming language. The web browser receives the JavaScript code in its original text form and runs the script from that. From a technical standpoint, most modern JavaScript interpreters actually use a technique called just-in-time compiling to improve performance; the JavaScript source code gets compiled into a faster, binary format while the script is being used, so that it can be run as quickly as possible.This book is much helpful!', 15, 15,  'FE', 'data:image/png;base64,'),
	(3,'Exploring Vue.js','RUFUS STEWART','Vue JS is a JavaScript framework for building user interfaces. It builds on top of standard HTML, CSS, and JavaScript and provides a declarative and component-based programming model that helps you efficiently develop user interfaces, be they simple or complex.Vue extends standard HTML with a template syntax that allows us to declaratively describe HTML output based on JavaScript state.This is the best book for learning and implementing!', 10, 10, 'FE', 'data:image/png;base64,'),
	(4,'Advanced Techniques in Big Data','Alexander','Big data is a term that describes large, hard-to-manage volumes of data both structured and unstructured that inundate businesses on a day-to-day basis. But it is not just the type or amount of data that is important, it is what organizations do with the data that matters. Big data can be analyzed for insights that improve decisions and give confidence for making strategic business movesBig data refers to data that is so large, fast or complex that it is difficult or impossible to process using traditional methods. The act of accessing and storing large amounts of information for analytics has been around for a long time.This book will be really helpful!', 12, 12, 'Data', 'data:image/png;base64,'),
